import React from "react";
import './Hero.css';

const Hero = () => {
    return (
        <div className='hero'>
            <div className='hero-content'>
                <div className='hero-text'>
                    <h1 className='hero-title'>Be Your Own Brand</h1>
                    <p className='hero-tagline'>Discover our latest collection or make your own style</p>
                    <button className='hero-latest-button'>Latest Collection</button>
                </div>
            </div>
        </div>
    );
}

export default Hero;
